/* eslint-disable react-hooks/exhaustive-deps */
import React, { useEffect, useState } from 'react'
import Card from '@mui/material/Card'
import CardActions from '@mui/material/CardActions'
import CardContent from '@mui/material/CardContent'
import CardMedia from '@mui/material/CardMedia'
import Button from '@mui/material/Button'
import Typography from '@mui/material/Typography'
import { Box, Grid, styled } from '@mui/material'
import { Link, useNavigate } from "react-router-dom";
import InfiniteScroll from "react-infinite-scroll-component";
import NFTCard from './NftCard'

const CardBody = styled(Box)(
  () => `

    margin: 30px 100px;
    width: 100%;
    display: flex;
    flex-wrap: wrap;
    gap:2.5%;

}
  `,
)

const Body = styled(Card)(
  () => `
  width:20%;
  margin-bottom:2%;
  cursor:pointer;
  border: 1px solid;
  box-shadow: 5px 4px #342929;
  border-radius: 6%;


}
  `,
)

function NftLists(props) {
  const navigate = useNavigate();
  const [data,setData]=useState([])
  const [Page,setPage]=useState(4)



  const { testdata } = props
  // console.log(testdata.length)

  useEffect(()=>{
    const  apiData = async() => {
      console.log("call")
     // const response = await fetch(`https://api.instantwebtools.net/v1/passenger?page=${Page}&size=10`);
      const jsonData = await response.json();
      console.log(jsonData)
      setData(jsonData.data)

    };
    apiData()
  },[])

  const  fetchMoreData = async() => {
      setPage(Page +1)
      // const response = await fetch(`https://api.instantwebtools.net/v1/passenger?page=${Page}&size=10`);
      // const jsonData = await response.json();
      // setData(jsonData.data)
      // setData(data.concat(jsonData.data))

  };
  return (
    <>
     <InfiniteScroll
          dataLength={data?.length}
          next={fetchMoreData}
          hasMore={true}
          loader={<h4>Loading...</h4>}
        >

    {console.log("data",data)}
      <CardBody>
        {data?.map((d) => {
          return (
            <>

              <Body >
              <Link to="/details" state={{ d: d }}>
               <NFTCard data={d}/>
                </Link>
              </Body>


            </>
          )
        })}
      </CardBody>

      </InfiniteScroll>
    </>
  )
}

export default NftLists
